        address owner;
        address charContractAddress;
        uint256 characterId;

        Position position;
        // 20,000 to write a word vs. 3 to add numbers, will not store updated characteristics
        uint8 healthDmgTaken;
        uint8 armorDmgTaken;
        uint8 actionsTaken;

        uint8 dataTokens;
        uint8[] currentEffects; // Use mapping and mark true if effect is present
